function ListDrivers() {
    const driversList = ["Rafsan", "Ispahan", "Labiba"];
    unorderedListString = "ul";

    driversList.forEach(function(driver) {
        unorderedListString+= "<l1>{driver}</l1>";
    })

    return unorderedListString;
} export default ListDrivers
